Este soneto, conocido como "A una botella de vino añejo", es característico del estilo conceptista de Quevedo, donde utiliza un elaborado juego de palabras y metáforas para comparar una botella de vino añejo con una dama anciana, empleando el doble sentido y la ironía típicos de su obra.
